import React, { useEffect } from 'react';
import PitchingDataLineGraph from './PitchingDataLineGraph';
//import './GraphsPage.css';

const PDFGraphsPage = ({gData}) => {
  const [groupedData, setGroupedData] = React.useState(gData);

  useEffect(() => {
    setGroupedData(gData);
  }, [gData]);

  return (
    <div>
      {Object.keys(groupedData).map((key) => (
        <div id={`graphSection-${index}`} key={key}>
        <div key={key}>
          <h2>Graph for {key.replace('_', ' & ')}</h2>
          <PitchingDataLineGraph data={groupedData[key].map(row => row.slice(3))} />

          {/* Displaying data below each graph */}
          <div>
            <table>
              <thead>
                <tr>
                  <th>Velocity</th>
                  <th>Ind. Vert Break</th>
                  <th>Horz Break</th>
                  <th>Spin Rate</th>
                  <th>RelHeight</th>
                  <th>Extension</th>
                  <th>Vert App Angle</th>
                  <th>Pitch Grade</th>
                </tr>
              </thead>
              <tbody>
                {groupedData[key].map((row, index) => (
                  <tr key={index}>
                    {row.slice(3).map((cell, cellIndex) => (
                      <td key={cellIndex}>{cell}</td>
                    ))}
                  </tr>
                ))}
              </tbody>
            </table>
          </div>
          </div>
        </div>
      ))}
    </div>

  );
};

export default PDFGraphsPage;
